contracts/SealGuardAccessControl.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title SealGuardAccessControl
 * @dev Access control contract for SealGuard system
 * Manages roles, permissions, and document access rights
 */
contract SealGuardAccessControl is AccessControl, ReentrancyGuard {

    // Role definitions - aligned with backend hierarchy
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    bytes32 public constant MODERATOR_ROLE = keccak256("MODERATOR_ROLE");
    bytes32 public constant AUDITOR_ROLE = keccak256("AUDITOR_ROLE");
    bytes32 public constant VERIFIER_ROLE = keccak256("VERIFIER_ROLE");
    bytes32 public constant DOCUMENT_MANAGER_ROLE = keccak256("DOCUMENT_MANAGER_ROLE");
    bytes32 public constant USER_ROLE = keccak256("USER_ROLE");

    // Role hierarchy levels
    mapping(bytes32 => uint8) public roleHierarchy;

    // User role assignments
    mapping(address => bytes32) public userRoles;

    struct AccessPermission {
        uint256 documentId;
        address grantee;
        address grantor;
        uint256 expiresAt;
        bool canRead;
        bool canVerify;
        bool canTransfer;
        uint256 grantedAt;
        bool isActive;
    }

    struct OrganizationMember {
        address member;
        string role;
        uint256 joinedAt;
        bool isActive;
    }

    // Mappings
    mapping(uint256 => mapping(address => AccessPermission)) public documentAccess;
    mapping(uint256 => address[]) public documentAccessList;
    mapping(string => address[]) public organizationMembers;
    mapping(address => string[]) public userOrganizations;
    mapping(string => mapping(address => OrganizationMember)) public orgMemberDetails;

    // Events
    event AccessGranted(
        uint256 indexed documentId,
        address indexed grantee,
        address indexed grantor,
        uint256 expiresAt
    );

    event AccessRevoked(
        uint256 indexed documentId,
        address indexed grantee,
        address indexed revoker
    );

    event OrganizationJoined(
        string indexed organizationId,
        address indexed member,
        string role
    );

    event OrganizationLeft(
        string indexed organizationId,
        address indexed member
    );



    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(ADMIN_ROLE, msg.sender);
        _grantRole(MODERATOR_ROLE, msg.sender);
        _grantRole(AUDITOR_ROLE, msg.sender);
        _grantRole(VERIFIER_ROLE, msg.sender);
        _grantRole(DOCUMENT_MANAGER_ROLE, msg.sender);
        _grantRole(USER_ROLE, msg.sender);

        // Initialize role hierarchy (higher number = more permissions)
        roleHierarchy[USER_ROLE] = 1;
        roleHierarchy[VERIFIER_ROLE] = 2;
        roleHierarchy[AUDITOR_ROLE] = 3;
        roleHierarchy[DOCUMENT_MANAGER_ROLE] = 3;
        roleHierarchy[MODERATOR_ROLE] = 4;
        roleHierarchy[ADMIN_ROLE] = 5;

        // Set deployer as admin
        userRoles[msg.sender] = ADMIN_ROLE;
    }

    /**
     * @dev Grant access to a document
     * @param documentId The ID of the document
     * @param grantee The address to grant access to
     * @param expiresAt Timestamp when access expires (0 for no expiry)
     * @param canRead Whether the grantee can read the document
     * @param canVerify Whether the grantee can verify the document
     * @param canTransfer Whether the grantee can transfer the document
     */
    function grantDocumentAccess(
        uint256 documentId,
        address grantee,
        uint256 expiresAt,
        bool canRead,
        bool canVerify,
        bool canTransfer
    ) external nonReentrant {
        require(grantee != address(0), "Invalid grantee address");
        require(grantee != msg.sender, "Cannot grant access to self");
        require(
            hasRole(DOCUMENT_MANAGER_ROLE, msg.sender) || 
            _isDocumentOwner(documentId, msg.sender),
            "Not authorized to grant access"
        );

        if (expiresAt > 0) {
            require(expiresAt > block.timestamp, "Expiry time must be in future");
        }

        AccessPermission storage permission = documentAccess[documentId][grantee];

        // If permission doesn't exist, add to access list
        if (!permission.isActive) {
            documentAccessList[documentId].push(grantee);
        }

        permission.documentId = documentId;
        permission.grantee = grantee;
        permission.grantor = msg.sender;
        permission.expiresAt = expiresAt;
        permission.canRead = canRead;
        permission.canVerify = canVerify;
        permission.canTransfer = canTransfer;
        permission.grantedAt = block.timestamp;
        permission.isActive = true;

        emit AccessGranted(documentId, grantee, msg.sender, expiresAt);
    }

    /**
     * @dev Revoke access to a document
     * @param documentId The ID of the document
     * @param grantee The address to revoke access from
     */
    function revokeDocumentAccess(
        uint256 documentId,
        address grantee
    ) external nonReentrant {
        require(
            hasRole(DOCUMENT_MANAGER_ROLE, msg.sender) || 
            _isDocumentOwner(documentId, msg.sender) ||
            documentAccess[documentId][grantee].grantor == msg.sender,
            "Not authorized to revoke access"
        );

        AccessPermission storage permission = documentAccess[documentId][grantee];
        require(permission.isActive, "Access not granted");

        permission.isActive = false;

        // Remove from access list
        _removeFromAccessList(documentId, grantee);

        emit AccessRevoked(documentId, grantee, msg.sender);
    }

    /**
     * @dev Check if an address has read access to a document
     * @param documentId The ID of the document
     * @param user The address to check
     */
    function hasReadAccess(uint256 documentId, address user) external view returns (bool) {
        if (_isDocumentOwner(documentId, user)) {
            return true;
        }

        AccessPermission memory permission = documentAccess[documentId][user];

        if (!permission.isActive || !permission.canRead) {
            return false;
        }

        // Check if access has expired
        if (permission.expiresAt > 0 && block.timestamp > permission.expiresAt) {
            return false;
        }

        return true;
    }

    /**
     * @dev Check if an address has verify access to a document
     * @param documentId The ID of the document
     * @param user The address to check
     */
    function hasVerifyAccess(uint256 documentId, address user) external view returns (bool) {
        if (_isDocumentOwner(documentId, user) || hasRole(VERIFIER_ROLE, user)) {
            return true;
        }

        AccessPermission memory permission = documentAccess[documentId][user];

        if (!permission.isActive || !permission.canVerify) {
            return false;
        }

        // Check if access has expired
        if (permission.expiresAt > 0 && block.timestamp > permission.expiresAt) {
            return false;
        }

        return true;
    }

    /**
     * @dev Check if an address has transfer access to a document
     * @param documentId The ID of the document
     * @param user The address to check
     */
    function hasTransferAccess(uint256 documentId, address user) external view returns (bool) {
        if (_isDocumentOwner(documentId, user)) {
            return true;
        }

        AccessPermission memory permission = documentAccess[documentId][user];

        if (!permission.isActive || !permission.canTransfer) {
            return false;
        }

        // Check if access has expired
        if (permission.expiresAt > 0 && block.timestamp > permission.expiresAt) {
            return false;
        }

        return true;
    }

    /**
     * @dev Assign role to user (only admin can assign roles)
     * @param user The address to assign role to
     * @param role The role to assign
     */
    function assignUserRole(address user, bytes32 role) external onlyRole(ADMIN_ROLE) {
        require(user != address(0), "Invalid user address");
        require(roleHierarchy[role] > 0, "Invalid role");

        // Revoke previous role if exists
        bytes32 currentRole = userRoles[user];
        if (currentRole != bytes32(0)) {
            _revokeRole(currentRole, user);
        }

        // Grant new role
        _grantRole(role, user);
        userRoles[user] = role;
    }

    /**
     * @dev Check if user has required role or higher in hierarchy
     * @param user The address to check
     * @param requiredRole The minimum required role
     */
    function hasRoleOrHigher(address user, bytes32 requiredRole) external view returns (bool) {
        bytes32 userRole = userRoles[user];
        if (userRole == bytes32(0)) return false;

        return roleHierarchy[userRole] >= roleHierarchy[requiredRole];
    }

    /**
     * @dev Get user's current role
     * @param user The address to check
     */
    function getUserRole(address user) external view returns (bytes32) {
        return userRoles[user];
    }

    /**
     * @dev Check if user can perform action based on role hierarchy
     * @param user The address to check
     * @param requiredLevel The minimum hierarchy level required
     */
    function canPerformAction(address user, uint8 requiredLevel) external view returns (bool) {
        bytes32 userRole = userRoles[user];
        if (userRole == bytes32(0)) return false;

        return roleHierarchy[userRole] >= requiredLevel;
    }

    /**
     * @dev Join an organization
     * @param organizationId The ID of the organization
     * @param role The role within the organization
     */
    function joinOrganization(
        string memory organizationId,
        string memory role
    ) external nonReentrant {
        require(bytes(organizationId).length > 0, "Invalid organization ID");
        require(bytes(role).length > 0, "Invalid role");
        require(
            !orgMemberDetails[organizationId][msg.sender].isActive,
            "Already a member"
        );

        organizationMembers[organizationId].push(msg.sender);
        userOrganizations[msg.sender].push(organizationId);

        orgMemberDetails[organizationId][msg.sender] = OrganizationMember({
            member: msg.sender,
            role: role,
            joinedAt: block.timestamp,
            isActive: true
        });

        emit OrganizationJoined(organizationId, msg.sender, role);
    }

    /**
     * @dev Leave an organization
     * @param organizationId The ID of the organization
     */
    function leaveOrganization(string memory organizationId) external nonReentrant {
        require(
            orgMemberDetails[organizationId][msg.sender].isActive,
            "Not a member"
        );

        orgMemberDetails[organizationId][msg.sender].isActive = false;

        // Remove from organization members list
        _removeFromOrganization(organizationId, msg.sender);

        // Remove from user organizations list
        _removeFromUserOrganizations(msg.sender, organizationId);

        emit OrganizationLeft(organizationId, msg.sender);
    }

    /**
     * @dev Get all members of an organization
     * @param organizationId The ID of the organization
     */
    function getOrganizationMembers(string memory organizationId) 
        external 
        view 
        returns (address[] memory) 
    {
        return organizationMembers[organizationId];
    }

    /**
     * @dev Get all organizations a user belongs to
     * @param user The address of the user
     */
    function getUserOrganizations(address user) 
        external 
        view 
        returns (string[] memory) 
    {
        return userOrganizations[user];
    }

    /**
     * @dev Get access list for a document
     * @param documentId The ID of the document
     */
    function getDocumentAccessList(uint256 documentId) 
        external 
        view 
        returns (address[] memory) 
    {
        return documentAccessList[documentId];
    }

    /**
     * @dev Get access permission details
     * @param documentId The ID of the document
     * @param user The address of the user
     */
    function getAccessPermission(uint256 documentId, address user) 
        external 
        view 
        returns (AccessPermission memory) 
    {
        return documentAccess[documentId][user];
    }

    /**
     * @dev Internal function to check if user is document owner
     * This should be implemented to check with the main registry contract
     */
    function _isDocumentOwner(uint256 documentId, address user) internal pure returns (bool) {
        // This is a placeholder - in practice, this would call the main registry contract
        // to check document ownership
        documentId; // Silence unused parameter warning
        user; // Silence unused parameter warning
        return false;
    }

    /**
     * @dev Internal function to remove address from document access list
     */
    function _removeFromAccessList(uint256 documentId, address user) internal {
        address[] storage accessList = documentAccessList[documentId];
        for (uint256 i = 0; i < accessList.length; i++) {
            if (accessList[i] == user) {
                accessList[i] = accessList[accessList.length - 1];
                accessList.pop();
                break;
            }
        }
    }

    /**
     * @dev Internal function to remove user from organization
     */
    function _removeFromOrganization(string memory organizationId, address user) internal {
        address[] storage members = organizationMembers[organizationId];
        for (uint256 i = 0; i < members.length; i++) {
            if (members[i] == user) {
                members[i] = members[members.length - 1];
                members.pop();
                break;
            }
        }
    }

    /**
     * @dev Internal function to remove organization from user's list
     */
    function _removeFromUserOrganizations(address user, string memory organizationId) internal {
        string[] storage orgs = userOrganizations[user];
        for (uint256 i = 0; i < orgs.length; i++) {
            if (keccak256(bytes(orgs[i])) == keccak256(bytes(organizationId))) {
                orgs[i] = orgs[orgs.length - 1];
                orgs.pop();
                break;
            }
        }
    }
}

contracts/SealGuardMultiSig.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./SealGuardAccessControl.sol";
import "./SealGuardRegistry.sol";

/**
 * @title SealGuardMultiSig
 * @dev Multi-signature approval workflows for SealGuard document verification
 * Handles complex verification scenarios requiring multiple approvers
 */
contract SealGuardMultiSig is ReentrancyGuard {
    SealGuardAccessControl public accessControl;
    SealGuardRegistry public registry;

    // Multi-signature proposal states
    enum ProposalState {
        PENDING,
        APPROVED,
        REJECTED,
        EXECUTED,
        CANCELLED,
        EXPIRED
    }

    // Types of multi-sig operations
    enum OperationType {
        DOCUMENT_VERIFICATION,
        OWNERSHIP_TRANSFER,
        ACCESS_GRANT,
        DOCUMENT_ARCHIVE,
        CONFIG_UPDATE,
        EMERGENCY_ACTION
    }

    struct MultiSigProposal {
        uint256 id;
        OperationType operationType;
        bytes32 documentId;
        address proposer;
        address[] requiredSigners;
        address[] approvers;
        mapping(address => bool) hasApproved;
        uint256 requiredApprovals;
        uint256 currentApprovals;
        uint256 createdAt;
        uint256 expiresAt;
        ProposalState state;
        bytes proposalData; // Encoded operation-specific data
        string reason;
    }

    struct MultiSigConfig {
        uint256 minSigners;
        uint256 maxSigners;
        uint256 approvalThreshold; // Percentage (e.g., 67 for 67%)
        uint256 proposalExpiry; // Time in seconds
        bool requiresUnanimous;
    }

    // State variables
    uint256 private _proposalIds;
    mapping(uint256 => MultiSigProposal) public proposals;
    mapping(bytes32 => MultiSigConfig) public documentConfigs; // document ID -> config
    mapping(string => MultiSigConfig) public typeConfigs; // document type -> config
    MultiSigConfig public defaultConfig;

    // Mappings for efficient queries
    mapping(address => uint256[]) public userProposals;
    mapping(bytes32 => uint256[]) public documentProposals;
    mapping(OperationType => uint256[]) public operationProposals;

    // Events
    event ProposalCreated(
        uint256 indexed proposalId,
        OperationType indexed operationType,
        bytes32 indexed documentId,
        address proposer,
        uint256 requiredApprovals
    );

    event ProposalApproved(
        uint256 indexed proposalId,
        address indexed approver,
        uint256 currentApprovals,
        uint256 requiredApprovals
    );

    event ProposalExecuted(
        uint256 indexed proposalId,
        OperationType indexed operationType,
        address indexed executor
    );

    event ProposalRejected(
        uint256 indexed proposalId,
        address indexed rejector,
        string reason
    );

    event ConfigUpdated(
        bytes32 indexed documentId,
        uint256 minSigners,
        uint256 approvalThreshold
    );

    // Modifiers
    modifier onlyAuthorized() {
        require(
            accessControl.hasRoleOrHigher(msg.sender, accessControl.VERIFIER_ROLE()),
            "Insufficient permissions"
        );
        _;
    }

    modifier proposalExists(uint256 proposalId) {
        require(proposals[proposalId].id != 0, "Proposal does not exist");
        _;
    }

    modifier proposalPending(uint256 proposalId) {
        require(proposals[proposalId].state == ProposalState.PENDING, "Proposal not pending");
        _;
    }

    constructor(
        address _accessControl,
        address _registry
    ) {
        accessControl = SealGuardAccessControl(_accessControl);
        registry = SealGuardRegistry(_registry);

        // Initialize default multi-sig configuration
        _initializeDefaultConfig();
    }

    /**
     * @dev Initialize default multi-signature configuration
     */
    function _initializeDefaultConfig() internal {
        defaultConfig.minSigners = 2;
        defaultConfig.maxSigners = 10;
        defaultConfig.approvalThreshold = 67; // 67%
        defaultConfig.proposalExpiry = 7 days;
        defaultConfig.requiresUnanimous = false;
    }

    /**
     * @dev Create a new multi-signature proposal
     * @param operationType The type of operation
     * @param documentId The document ID (if applicable)
     * @param requiredSigners Array of addresses that must sign
     * @param proposalData Encoded operation-specific data
     * @param reason Human-readable reason for the proposal
     */
    function createProposal(
        OperationType operationType,
        bytes32 documentId,
        address[] memory requiredSigners,
        bytes memory proposalData,
        string memory reason
    ) public onlyAuthorized nonReentrant returns (uint256) {
        require(requiredSigners.length >= 2, "Minimum 2 signers required");
        require(requiredSigners.length <= 10, "Maximum 10 signers allowed");

        _proposalIds++;
        uint256 proposalId = _proposalIds;

        // Get configuration for this operation
        MultiSigConfig memory config = _getConfigForDocument(documentId, operationType);
        uint256 requiredApprovals = _calculateRequiredApprovals(requiredSigners.length, config, operationType);

        // Create the proposal
        MultiSigProposal storage proposal = proposals[proposalId];
        proposal.id = proposalId;
        proposal.operationType = operationType;
        proposal.documentId = documentId;
        proposal.proposer = msg.sender;
        proposal.requiredSigners = requiredSigners;
        proposal.requiredApprovals = requiredApprovals;
        proposal.currentApprovals = 0;
        proposal.createdAt = block.timestamp;
        proposal.expiresAt = block.timestamp + config.proposalExpiry;
        proposal.state = ProposalState.PENDING;
        proposal.proposalData = proposalData;
        proposal.reason = reason;

        // Add to tracking mappings
        userProposals[msg.sender].push(proposalId);
        if (documentId != bytes32(0)) {
            documentProposals[documentId].push(proposalId);
        }
        operationProposals[operationType].push(proposalId);

        emit ProposalCreated(proposalId, operationType, documentId, msg.sender, requiredApprovals);

        return proposalId;
    }

    /**
     * @dev Approve a multi-signature proposal
     * @param proposalId The proposal ID to approve
     */
    function approveProposal(uint256 proposalId) 
        external 
        proposalExists(proposalId) 
        proposalPending(proposalId) 
        nonReentrant 
    {
        MultiSigProposal storage proposal = proposals[proposalId];

        // Check if proposal has expired
        require(block.timestamp <= proposal.expiresAt, "Proposal has expired");

        // Check if sender is a required signer
        bool isRequiredSigner = false;
        for (uint256 i = 0; i < proposal.requiredSigners.length; i++) {
            if (proposal.requiredSigners[i] == msg.sender) {
                isRequiredSigner = true;
                break;
            }
        }
        require(isRequiredSigner, "Not a required signer for this proposal");

        // Check if already approved
        require(!proposal.hasApproved[msg.sender], "Already approved this proposal");

        // Record approval
        proposal.hasApproved[msg.sender] = true;
        proposal.approvers.push(msg.sender);
        proposal.currentApprovals++;

        emit ProposalApproved(proposalId, msg.sender, proposal.currentApprovals, proposal.requiredApprovals);

        // Check if proposal can be executed
        if (proposal.currentApprovals >= proposal.requiredApprovals) {
            proposal.state = ProposalState.APPROVED;
            _executeProposal(proposalId);
        }
    }

    /**
     * @dev Reject a multi-signature proposal
     * @param proposalId The proposal ID to reject
     * @param rejectionReason Reason for rejection
     */
    function rejectProposal(
        uint256 proposalId,
        string memory rejectionReason
    ) external proposalExists(proposalId) proposalPending(proposalId) {
        MultiSigProposal storage proposal = proposals[proposalId];

        // Check if sender is a required signer or has admin role
        bool canReject = false;
        for (uint256 i = 0; i < proposal.requiredSigners.length; i++) {
            if (proposal.requiredSigners[i] == msg.sender) {
                canReject = true;
                break;
            }
        }

        if (!canReject) {
            require(
                accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
                "Not authorized to reject this proposal"
            );
        }

        proposal.state = ProposalState.REJECTED;

        emit ProposalRejected(proposalId, msg.sender, rejectionReason);
    }

    /**
     * @dev Execute an approved proposal
     * @param proposalId The proposal ID to execute
     */
    function _executeProposal(uint256 proposalId) internal {
        MultiSigProposal storage proposal = proposals[proposalId];

        if (proposal.operationType == OperationType.DOCUMENT_VERIFICATION) {
            _executeDocumentVerification(proposal);
        } else if (proposal.operationType == OperationType.OWNERSHIP_TRANSFER) {
            _executeOwnershipTransfer(proposal);
        } else if (proposal.operationType == OperationType.ACCESS_GRANT) {
            _executeAccessGrant(proposal);
        } else if (proposal.operationType == OperationType.DOCUMENT_ARCHIVE) {
            _executeDocumentArchive(proposal);
        }

        proposal.state = ProposalState.EXECUTED;

        emit ProposalExecuted(proposalId, proposal.operationType, msg.sender);
    }

    /**
     * @dev Execute document verification through multi-sig
     * @param proposal The proposal to execute
     */
    function _executeDocumentVerification(MultiSigProposal storage proposal) internal {
        // Decode verification data
        (bytes32 proofHash, string memory proofData, bool isValid) = abi.decode(
            proposal.proposalData,
            (bytes32, string, bool)
        );

        // Submit verification proof to registry
        registry.submitVerificationProof(
            uint256(proposal.documentId),
            proofHash,
            proofData,
            isValid
        );

        // Mark as multi-sig verified
        registry.markMultiSigVerified(uint256(proposal.documentId), proposal.id);
    }

    /**
     * @dev Execute ownership transfer through multi-sig
     * @param proposal The proposal to execute
     */
    function _executeOwnershipTransfer(MultiSigProposal storage proposal) internal {
        // Decode transfer data
        address newOwner = abi.decode(proposal.proposalData, (address));

        // Transfer document ownership
        registry.transferDocumentOwnership(uint256(proposal.documentId), newOwner);

        // Mark as multi-sig verified
        registry.markMultiSigVerified(uint256(proposal.documentId), proposal.id);
    }

    /**
     * @dev Execute access grant through multi-sig
     * @param proposal The proposal to execute
     */
    function _executeAccessGrant(MultiSigProposal storage proposal) internal {
        // Implementation would depend on access control system
        // This is a placeholder for the actual access granting logic
    }

    /**
     * @dev Execute document archive through multi-sig
     * @param proposal The proposal to execute
     */
    function _executeDocumentArchive(MultiSigProposal storage proposal) internal {
        // Archive the document
        registry.archiveDocument(uint256(proposal.documentId));

        // Mark as multi-sig verified
        registry.markMultiSigVerified(uint256(proposal.documentId), proposal.id);
    }

    /**
     * @dev Get configuration for a specific document and operation
     * @param documentId The document ID
     * @param operationType The operation type
     */
    function _getConfigForDocument(
        bytes32 documentId,
        OperationType operationType
    ) internal view returns (MultiSigConfig memory) {
        // Try document-specific config first
        if (documentConfigs[documentId].minSigners > 0) {
            return documentConfigs[documentId];
        }

        // Try document type config
        if (documentId != bytes32(0)) {
            SealGuardRegistry.Document memory doc = registry.getDocument(uint256(documentId));
            if (typeConfigs[doc.documentType].minSigners > 0) {
                return typeConfigs[doc.documentType];
            }
        }

        // Fall back to default config
        return defaultConfig;
    }



    /**
     * @dev Calculate required approvals based on configuration
     * @param signerCount Number of signers
     * @param config Multi-sig configuration
     * @param operationType Type of operation
     */
    function _calculateRequiredApprovals(
        uint256 signerCount,
        MultiSigConfig memory config,
        OperationType operationType
    ) internal pure returns (uint256) {
        if (config.requiresUnanimous) {
            return signerCount;
        }

        uint256 threshold = config.approvalThreshold;

        return (signerCount * threshold + 99) / 100; // Ceiling division
    }

    /**
     * @dev Get proposal details
     * @param proposalId The proposal ID
     */
    function getProposal(uint256 proposalId) 
        external 
        view 
        proposalExists(proposalId) 
        returns (
            uint256 id,
            OperationType operationType,
            bytes32 documentId,
            address proposer,
            address[] memory requiredSigners,
            address[] memory approvers,
            uint256 requiredApprovals,
            uint256 currentApprovals,
            uint256 createdAt,
            uint256 expiresAt,
            ProposalState state,
            string memory reason
        ) 
    {
        MultiSigProposal storage proposal = proposals[proposalId];
        return (
            proposal.id,
            proposal.operationType,
            proposal.documentId,
            proposal.proposer,
            proposal.requiredSigners,
            proposal.approvers,
            proposal.requiredApprovals,
            proposal.currentApprovals,
            proposal.createdAt,
            proposal.expiresAt,
            proposal.state,
            proposal.reason
        );
    }

    /**
     * @dev Check if an address has approved a proposal
     * @param proposalId The proposal ID
     * @param signer The signer address
     */
    function hasApproved(uint256 proposalId, address signer) 
        external 
        view 
        proposalExists(proposalId) 
        returns (bool) 
    {
        return proposals[proposalId].hasApproved[signer];
    }

    /**
     * @dev Get proposals by user
     * @param user The user address
     */
    function getUserProposals(address user) 
        external 
        view 
        returns (uint256[] memory) 
    {
        return userProposals[user];
    }

    /**
     * @dev Get proposals by document
     * @param documentId The document ID
     */
    function getDocumentProposals(bytes32 documentId) 
        external 
        view 
        returns (uint256[] memory) 
    {
        return documentProposals[documentId];
    }

    /**
     * @dev Get proposals for a specific document (uint256 version)
     * @param documentId The document ID
     * @return Array of proposal IDs
     */
    function getDocumentProposals(uint256 documentId) external view returns (uint256[] memory) {
        return documentProposals[bytes32(documentId)];
    }

    /**
     * @dev Update multi-sig configuration for a document type (admin only)
     * @param documentType The document type
     * @param minSigners Minimum number of signers
     * @param maxSigners Maximum number of signers
     * @param approvalThreshold Approval threshold percentage
     * @param proposalExpiry Proposal expiry time in seconds
     * @param requiresUnanimous Whether unanimous approval is required
     */
    function updateTypeConfig(
        string memory documentType,
        uint256 minSigners,
        uint256 maxSigners,
        uint256 approvalThreshold,
        uint256 proposalExpiry,
        bool requiresUnanimous
    ) external {
        require(
            accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
            "Only admin can update multi-sig config"
        );

        MultiSigConfig storage config = typeConfigs[documentType];
        config.minSigners = minSigners;
        config.maxSigners = maxSigners;
        config.approvalThreshold = approvalThreshold;
        config.proposalExpiry = proposalExpiry;
        config.requiresUnanimous = requiresUnanimous;
    }

    /**
     * @dev Get total number of proposals
     */
    function getTotalProposals() external view returns (uint256) {
        return _proposalIds;
    }

    /**
     * @dev Cancel a proposal (proposer or admin only)
     * @param proposalId The proposal ID to cancel
     */
    function cancelProposal(uint256 proposalId) 
        external 
        proposalExists(proposalId) 
        proposalPending(proposalId) 
    {
        MultiSigProposal storage proposal = proposals[proposalId];

        require(
            proposal.proposer == msg.sender ||
            accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
            "Only proposer or admin can cancel"
        );

        proposal.state = ProposalState.CANCELLED;
    }

    /**
     * @dev Expire old proposals (can be called by anyone)
     * @param proposalIds Array of proposal IDs to check for expiration
     */
    function expireProposals(uint256[] calldata proposalIds) external {
        for (uint256 i = 0; i < proposalIds.length; i++) {
            if (proposals[proposalIds[i]].id != 0 &&
                proposals[proposalIds[i]].state == ProposalState.PENDING &&
                block.timestamp > proposals[proposalIds[i]].expiresAt) {
                proposals[proposalIds[i]].state = ProposalState.EXPIRED;
            }
        }
    }

    /**
     * @dev Create a verification proposal
     * @param documentId The document ID
     * @param proofHash Hash of the verification proof
     * @param proofData Proof data
     * @param isValid Whether the proof is valid
     * @return The proposal ID
     */
    function createVerificationProposal(
        uint256 documentId,
        bytes32 proofHash,
        string memory proofData,
        bool isValid
    ) external returns (uint256) {
        bytes memory proposalData = abi.encode(proofHash, proofData, isValid);

        address[] memory requiredSigners = _getRequiredSigners(bytes32(documentId), OperationType.DOCUMENT_VERIFICATION);

        return createProposal(
            OperationType.DOCUMENT_VERIFICATION,
            bytes32(documentId),
            requiredSigners,
            proposalData,
            "Document verification proposal"
        );
    }

    /**
     * @dev Create an ownership transfer proposal
     * @param documentId The document ID
     * @param newOwner The new owner address
     * @return The proposal ID
     */
    function createOwnershipTransferProposal(
        uint256 documentId,
        address newOwner
    ) external returns (uint256) {
        bytes memory proposalData = abi.encode(newOwner);

        address[] memory requiredSigners = _getRequiredSigners(bytes32(documentId), OperationType.OWNERSHIP_TRANSFER);

        return createProposal(
            OperationType.OWNERSHIP_TRANSFER,
            bytes32(documentId),
            requiredSigners,
            proposalData,
            "Document ownership transfer proposal"
        );
    }

    /**
     * @dev Create an archive proposal
     * @param documentId The document ID
     * @return The proposal ID
     */
    function createArchiveProposal(uint256 documentId) external returns (uint256) {
        bytes memory proposalData = abi.encode(documentId);

        address[] memory requiredSigners = _getRequiredSigners(bytes32(documentId), OperationType.DOCUMENT_ARCHIVE);

        return createProposal(
            OperationType.DOCUMENT_ARCHIVE,
            bytes32(documentId),
            requiredSigners,
            proposalData,
            "Document archive proposal"
        );
    }

    /**
     * @dev Get required signers for a document operation
     * @param documentId The document ID
     * @param operationType The operation type
     */
    function _getRequiredSigners(
        bytes32 documentId,
        OperationType operationType
    ) internal view returns (address[] memory) {
        // This is a simplified implementation
        // In a real system, this would determine signers based on document ownership,
        // access control roles, and operation type

        address[] memory signers = new address[](2);

        if (documentId != bytes32(0)) {
            SealGuardRegistry.Document memory doc = registry.getDocument(uint256(documentId));
            signers[0] = doc.owner;
        } else {
            signers[0] = msg.sender;
        }

        // Add a verifier as second signer
        // This would typically come from access control or document-specific settings
        signers[1] = msg.sender; // Placeholder - should be actual verifier

        return signers;
    }
}

contracts/SealGuardRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./SealGuardAccessControl.sol";
import "./SealGuardMultiSig.sol";

/**
 * @title SealGuardRegistry
 * @dev Core smart contract for SealGuard document verification system
 * Manages document registration, verification proofs, and access control
 */
contract SealGuardRegistry is Ownable, ReentrancyGuard {
    uint256 private _documentIds;
    SealGuardAccessControl public accessControl;
    SealGuardMultiSig public multiSig;
    
    // Multi-signature requirements
    mapping(uint256 => bool) public requiresMultiSig; // document ID -> requires multi-sig
    mapping(string => bool) public typeRequiresMultiSig; // document type -> requires multi-sig
    mapping(uint256 => bool) public multiSigVerified; // document ID -> multi-sig verified
    
    // Document lifecycle states
    enum DocumentLifecycle {
        PENDING,
        PROCESSING,
        VERIFIED,
        REJECTED,
        EXPIRED,
        ARCHIVED
    }
    
    // Automated verification settings
    struct AutoVerificationConfig {
        bool enabled;
        uint256 timeThreshold; // Auto-verify after X seconds if no manual verification
        uint256 consensusThreshold; // Number of verifiers needed for consensus
        bool requiresManualApproval; // Whether manual approval is always required
        uint256 maxAutoVerifications; // Max auto-verifications per day
    }
    
    // Verification trigger types
    enum TriggerType {
        MANUAL,
        TIME_BASED,
        CONSENSUS_BASED,
        THRESHOLD_BASED,
        AUTOMATED
    }
    
    // Auto-verification mappings
    mapping(string => AutoVerificationConfig) public autoVerificationConfigs; // document type -> config
    mapping(uint256 => uint256) public autoVerificationCount; // document ID -> count
    mapping(uint256 => uint256) public lastAutoVerification; // document ID -> timestamp
    mapping(uint256 => TriggerType) public verificationTriggers; // document ID -> trigger type
    
    // Document expiration settings
    mapping(string => uint256) public documentTypeExpiry; // document type -> expiry duration in seconds
    mapping(uint256 => uint256) public documentExpiry; // document ID -> expiry timestamp
    
    struct Document {
        uint256 id;
        string filecoinCID;
        bytes32 fileHash;
        bytes32 proofHash;
        address owner;
        uint256 timestamp;
        uint256 lastVerified;
        bool isVerified;
        string metadata; // JSON metadata
        uint256 fileSize;
        string documentType;
        DocumentLifecycle lifecycle;
        uint256 expiresAt;
    }
    
    struct VerificationProof {
        uint256 documentId;
        bytes32 proofHash;
        uint256 timestamp;
        address verifier;
        bool isValid;
        string proofData; // JSON proof data
    }
    
    // Mappings
    mapping(uint256 => Document) public documents;
    mapping(address => uint256[]) public userDocuments;
    mapping(uint256 => VerificationProof[]) public documentProofs;
    mapping(bytes32 => uint256) public hashToDocumentId;
    
    // Events
    event DocumentRegistered(
        uint256 indexed documentId,
        address indexed owner,
        string filecoinCID,
        bytes32 fileHash
    );
    
    event DocumentVerified(
        uint256 indexed documentId,
        address indexed verifier,
        bytes32 proofHash,
        bool isValid
    );
    
    event OwnershipTransferred(
        uint256 indexed documentId,
        address indexed previousOwner,
        address indexed newOwner
    );
    
    event AutoVerificationTriggered(
        uint256 indexed documentId,
        TriggerType triggerType,
        address indexed triggeredBy,
        uint256 timestamp
    );
    
    event AutoVerificationConfigUpdated(
        string indexed documentType,
        bool enabled,
        uint256 timeThreshold,
        uint256 consensusThreshold
    );
    
    event VerificationThresholdReached(
        uint256 indexed documentId,
        uint256 verifierCount,
        uint256 threshold
    );
    
    event MultiSigRequirementSet(
        uint256 indexed documentId,
        bool required,
        string documentType
    );
    
    event MultiSigVerificationCompleted(
        uint256 indexed documentId,
        address indexed multiSigContract,
        uint256 proposalId
    );
    
    // Modifiers
    modifier onlyDocumentOwner(uint256 documentId) {
        require(documents[documentId].owner == msg.sender, "Not document owner");
        _;
    }
    
    modifier documentExists(uint256 documentId) {
        require(documents[documentId].id != 0, "Document does not exist");
        _;
    }
    
    constructor(address initialOwner, address _accessControl) Ownable(initialOwner) {
        accessControl = SealGuardAccessControl(_accessControl);
        
        // Set default expiry times for document types (in seconds)
        documentTypeExpiry["legal"] = 365 days * 7; // 7 years for legal documents
        documentTypeExpiry["financial"] = 365 days * 10; // 10 years for financial documents
        documentTypeExpiry["medical"] = 365 days * 30; // 30 years for medical records
        documentTypeExpiry["identity"] = 365 days * 10; // 10 years for identity documents
        documentTypeExpiry["contract"] = 365 days * 20; // 20 years for contracts
        documentTypeExpiry["default"] = 365 days * 5; // 5 years default
        
        // Initialize auto-verification configs
        _initializeAutoVerificationConfigs();
        
        // Initialize multi-signature requirements
        _initializeMultiSigRequirements();
    }
    
    /**
     * @dev Register a new document on Filecoin
     * @param filecoinCID The Filecoin CID of the stored document
     * @param fileHash SHA256 hash of the original file
     * @param metadata JSON metadata string
     * @param fileSize Size of the file in bytes
     * @param documentType Type/category of the document
     */
    function registerDocument(
        string memory filecoinCID,
        bytes32 fileHash,
        string memory metadata,
        uint256 fileSize,
        string memory documentType
    ) external nonReentrant returns (uint256) {
        require(bytes(filecoinCID).length > 0, "Invalid Filecoin CID");
        require(fileHash != bytes32(0), "Invalid file hash");
        require(hashToDocumentId[fileHash] == 0, "Document already exists");
        
        _documentIds++;
        uint256 documentId = _documentIds;
        
        // Calculate expiry time based on document type
        uint256 expiryDuration = documentTypeExpiry[documentType];
        if (expiryDuration == 0) {
            expiryDuration = documentTypeExpiry["default"];
        }
        uint256 expiresAt = block.timestamp + expiryDuration;
        
        documents[documentId] = Document({
            id: documentId,
            filecoinCID: filecoinCID,
            fileHash: fileHash,
            proofHash: bytes32(0),
            owner: msg.sender,
            timestamp: block.timestamp,
            lastVerified: 0,
            isVerified: false,
            metadata: metadata,
            fileSize: fileSize,
            documentType: documentType,
            lifecycle: DocumentLifecycle.PENDING,
            expiresAt: expiresAt
        });
        
        documentExpiry[documentId] = expiresAt;
        
        userDocuments[msg.sender].push(documentId);
        hashToDocumentId[fileHash] = documentId;
        
        emit DocumentRegistered(documentId, msg.sender, filecoinCID, fileHash);
        
        return documentId;
    }
    
    /**
     * @dev Submit a verification proof for a document
     * @param documentId The ID of the document to verify
     * @param proofHash Hash of the verification proof
     * @param proofData JSON string containing proof details
     * @param isValid Whether the proof is valid
     */
    function submitVerificationProof(
        uint256 documentId,
        bytes32 proofHash,
        string memory proofData,
        bool isValid
    ) external documentExists(documentId) nonReentrant {
        require(proofHash != bytes32(0), "Invalid proof hash");
        require(
            accessControl.hasRoleOrHigher(msg.sender, accessControl.VERIFIER_ROLE()),
            "Insufficient permissions to verify"
        );
        require(
            documents[documentId].lifecycle != DocumentLifecycle.EXPIRED &&
            documents[documentId].lifecycle != DocumentLifecycle.ARCHIVED,
            "Document is expired or archived"
        );
        
        // Update document lifecycle to processing
        documents[documentId].lifecycle = DocumentLifecycle.PROCESSING;
        
        VerificationProof memory proof = VerificationProof({
            documentId: documentId,
            proofHash: proofHash,
            timestamp: block.timestamp,
            verifier: msg.sender,
            isValid: isValid,
            proofData: proofData
        });
        
        documentProofs[documentId].push(proof);
        
        // Update document verification status and lifecycle
        if (isValid) {
            documents[documentId].proofHash = proofHash;
            documents[documentId].lastVerified = block.timestamp;
            documents[documentId].isVerified = true;
            documents[documentId].lifecycle = DocumentLifecycle.VERIFIED;
        } else {
            documents[documentId].lifecycle = DocumentLifecycle.REJECTED;
        }
        
        // Check if this triggers automated verification
        _checkAutomatedVerificationTriggers(documentId);
        
        emit DocumentVerified(documentId, msg.sender, proofHash, isValid);
    }
    
    /**
     * @dev Transfer ownership of a document
     * @param documentId The ID of the document
     * @param newOwner The address of the new owner
     */
    function transferDocumentOwnership(
        uint256 documentId,
        address newOwner
    ) external onlyDocumentOwner(documentId) {
        require(newOwner != address(0), "Invalid new owner address");
        require(newOwner != msg.sender, "Cannot transfer to self");
        
        address previousOwner = documents[documentId].owner;
        documents[documentId].owner = newOwner;
        
        // Update user document arrays
        _removeDocumentFromUser(previousOwner, documentId);
        userDocuments[newOwner].push(documentId);
        
        emit OwnershipTransferred(documentId, previousOwner, newOwner);
    }
    
    /**
     * @dev Get document details
     * @param documentId The ID of the document
     */
    function getDocument(uint256 documentId) 
        external 
        view 
        documentExists(documentId) 
        returns (Document memory) 
    {
        return documents[documentId];
    }
    
    /**
     * @dev Get all documents owned by a user
     * @param user The address of the user
     */
    function getUserDocuments(address user) 
        external 
        view 
        returns (uint256[] memory) 
    {
        return userDocuments[user];
    }
    
    /**
     * @dev Get verification proofs for a document
     * @param documentId The ID of the document
     */
    function getDocumentProofs(uint256 documentId) 
        external 
        view 
        documentExists(documentId) 
        returns (VerificationProof[] memory) 
    {
        return documentProofs[documentId];
    }
    
    /**
     * @dev Get the latest verification proof for a document
     * @param documentId The ID of the document
     */
    function getLatestProof(uint256 documentId) 
        external 
        view 
        documentExists(documentId) 
        returns (VerificationProof memory) 
    {
        VerificationProof[] memory proofs = documentProofs[documentId];
        require(proofs.length > 0, "No proofs found");
        return proofs[proofs.length - 1];
    }
    
    /**
     * @dev Get total number of documents
     */
    function getTotalDocuments() external view returns (uint256) {
        return _documentIds;
    }
    
    /**
     * @dev Check if a document exists by file hash
     * @param fileHash The SHA256 hash of the file
     */
    function documentExistsByHash(bytes32 fileHash) external view returns (bool) {
        return hashToDocumentId[fileHash] != 0;
    }
    
    /**
     * @dev Get document ID by file hash
     * @param fileHash The SHA256 hash of the file
     */
    function getDocumentIdByHash(bytes32 fileHash) external view returns (uint256) {
        return hashToDocumentId[fileHash];
    }
    
    /**
     * @dev Archive a document (only owner or admin)
     * @param documentId The document ID to archive
     */
    function archiveDocument(uint256 documentId) external documentExists(documentId) {
        require(
            documents[documentId].owner == msg.sender ||
            accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
            "Only owner or admin can archive"
        );
        documents[documentId].lifecycle = DocumentLifecycle.ARCHIVED;
    }
    
    /**
     * @dev Mark document as expired (automated or admin)
     * @param documentId The document ID to expire
     */
    function expireDocument(uint256 documentId) external documentExists(documentId) {
        require(
            block.timestamp >= documents[documentId].expiresAt ||
            accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
            "Document not yet expired or insufficient permissions"
        );
        documents[documentId].lifecycle = DocumentLifecycle.EXPIRED;
    }
    
    /**
     * @dev Check if document is expired
     * @param documentId The document ID to check
     */
    function isDocumentExpired(uint256 documentId) external view documentExists(documentId) returns (bool) {
        return block.timestamp >= documents[documentId].expiresAt;
    }
    
    /**
     * @dev Get document lifecycle status
     * @param documentId The document ID
     */
    function getDocumentLifecycle(uint256 documentId) external view documentExists(documentId) returns (DocumentLifecycle) {
        return documents[documentId].lifecycle;
    }
    
    /**
     * @dev Internal function to remove document from user's array
     * @param user The user address
     * @param documentId The document ID to remove
     */
    function _removeDocumentFromUser(address user, uint256 documentId) internal {
        uint256[] storage docs = userDocuments[user];
        for (uint256 i = 0; i < docs.length; i++) {
            if (docs[i] == documentId) {
                docs[i] = docs[docs.length - 1];
                docs.pop();
                break;
            }
        }
    }
    
    /**
     * @dev Initialize auto-verification configurations for document types
     */
    function _initializeAutoVerificationConfigs() internal {
        // Legal documents - require manual approval
        autoVerificationConfigs["legal"] = AutoVerificationConfig({
            enabled: true,
            timeThreshold: 24 hours,
            consensusThreshold: 3,
            requiresManualApproval: true,
            maxAutoVerifications: 10
        });
        
        // Financial documents - moderate automation
        autoVerificationConfigs["financial"] = AutoVerificationConfig({
            enabled: true,
            timeThreshold: 12 hours,
            consensusThreshold: 2,
            requiresManualApproval: false,
            maxAutoVerifications: 20
        });
        
        // Identity documents - strict verification
        autoVerificationConfigs["identity"] = AutoVerificationConfig({
            enabled: true,
            timeThreshold: 48 hours,
            consensusThreshold: 3,
            requiresManualApproval: true,
            maxAutoVerifications: 5
        });
        
        // Default configuration
        autoVerificationConfigs["default"] = AutoVerificationConfig({
            enabled: true,
            timeThreshold: 6 hours,
            consensusThreshold: 2,
            requiresManualApproval: false,
            maxAutoVerifications: 15
        });
    }
    
    /**
     * @dev Check and trigger automated verification if conditions are met
     * @param documentId The document ID to check
     */
    function _checkAutomatedVerificationTriggers(uint256 documentId) internal {
        Document storage doc = documents[documentId];
        AutoVerificationConfig memory config = autoVerificationConfigs[doc.documentType];
        
        if (config.timeThreshold == 0) {
            config = autoVerificationConfigs["default"];
        }
        
        if (!config.enabled) return;
        
        // Check time-based trigger
        if (block.timestamp >= doc.timestamp + config.timeThreshold &&
            doc.lifecycle == DocumentLifecycle.PENDING) {
            _triggerTimeBasedVerification(documentId, config);
        }
        
        // Check consensus-based trigger
        uint256 verificationCount = documentProofs[documentId].length;
        if (verificationCount >= config.consensusThreshold &&
            doc.lifecycle == DocumentLifecycle.PROCESSING) {
            _triggerConsensusBasedVerification(documentId, config);
        }
    }
    
    /**
     * @dev Trigger time-based automated verification
     * @param documentId The document ID
     * @param config The auto-verification configuration
     */
    function _triggerTimeBasedVerification(uint256 documentId, AutoVerificationConfig memory config) internal {
        if (_canAutoVerify(documentId, config)) {
            documents[documentId].lifecycle = DocumentLifecycle.PROCESSING;
            verificationTriggers[documentId] = TriggerType.TIME_BASED;
            autoVerificationCount[documentId]++;
            lastAutoVerification[documentId] = block.timestamp;
            
            emit AutoVerificationTriggered(documentId, TriggerType.TIME_BASED, address(this), block.timestamp);
        }
    }
    
    /**
     * @dev Trigger consensus-based automated verification
     * @param documentId The document ID
     * @param config The auto-verification configuration
     */
    function _triggerConsensusBasedVerification(uint256 documentId, AutoVerificationConfig memory config) internal {
        if (_canAutoVerify(documentId, config)) {
            // Check if consensus is positive
            uint256 validProofs = 0;
            VerificationProof[] memory proofs = documentProofs[documentId];
            
            for (uint256 i = 0; i < proofs.length; i++) {
                if (proofs[i].isValid) {
                    validProofs++;
                }
            }
            
            if (validProofs >= config.consensusThreshold) {
                documents[documentId].lifecycle = DocumentLifecycle.VERIFIED;
                documents[documentId].isVerified = true;
                documents[documentId].lastVerified = block.timestamp;
                verificationTriggers[documentId] = TriggerType.CONSENSUS_BASED;
                
                emit AutoVerificationTriggered(documentId, TriggerType.CONSENSUS_BASED, address(this), block.timestamp);
                emit VerificationThresholdReached(documentId, validProofs, config.consensusThreshold);
            }
        }
    }
    
    /**
     * @dev Check if document can be auto-verified based on limits
     * @param documentId The document ID
     * @param config The auto-verification configuration
     */
    function _canAutoVerify(uint256 documentId, AutoVerificationConfig memory config) internal view returns (bool) {
        // Check daily limit
        if (lastAutoVerification[documentId] > 0 &&
            block.timestamp < lastAutoVerification[documentId] + 1 days &&
            autoVerificationCount[documentId] >= config.maxAutoVerifications) {
            return false;
        }
        
        // Check if manual approval is required
        if (config.requiresManualApproval) {
            return false;
        }
        
        return true;
    }
    
    /**
     * @dev Manually trigger automated verification (admin only)
     * @param documentId The document ID
     * @param triggerType The type of trigger to use
     */
    function triggerAutomatedVerification(
        uint256 documentId,
        TriggerType triggerType
    ) external documentExists(documentId) {
        require(
            accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
            "Only admin can manually trigger automated verification"
        );
        
        Document storage doc = documents[documentId];
        AutoVerificationConfig memory config = autoVerificationConfigs[doc.documentType];
        
        if (config.timeThreshold == 0) {
            config = autoVerificationConfigs["default"];
        }
        
        if (triggerType == TriggerType.TIME_BASED) {
            _triggerTimeBasedVerification(documentId, config);
        } else if (triggerType == TriggerType.CONSENSUS_BASED) {
            _triggerConsensusBasedVerification(documentId, config);
        }
        
        verificationTriggers[documentId] = triggerType;
        emit AutoVerificationTriggered(documentId, triggerType, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Update auto-verification configuration for a document type (admin only)
     * @param documentType The document type
     * @param enabled Whether auto-verification is enabled
     * @param timeThreshold Time threshold in seconds
     * @param consensusThreshold Number of verifiers needed for consensus
     * @param requiresManualApproval Whether manual approval is required
     * @param maxAutoVerifications Maximum auto-verifications per day
     */
    function updateAutoVerificationConfig(
        string memory documentType,
        bool enabled,
        uint256 timeThreshold,
        uint256 consensusThreshold,
        bool requiresManualApproval,
        uint256 maxAutoVerifications
    ) external {
        require(
            accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
            "Only admin can update auto-verification config"
        );
        
        autoVerificationConfigs[documentType] = AutoVerificationConfig({
            enabled: enabled,
            timeThreshold: timeThreshold,
            consensusThreshold: consensusThreshold,
            requiresManualApproval: requiresManualApproval,
            maxAutoVerifications: maxAutoVerifications
        });
        
        emit AutoVerificationConfigUpdated(documentType, enabled, timeThreshold, consensusThreshold);
    }
    
    /**
     * @dev Get auto-verification configuration for a document type
     * @param documentType The document type
     */
    function getAutoVerificationConfig(string memory documentType) 
        external 
        view 
        returns (AutoVerificationConfig memory) 
    {
        AutoVerificationConfig memory config = autoVerificationConfigs[documentType];
        if (config.timeThreshold == 0) {
            config = autoVerificationConfigs["default"];
        }
        return config;
    }
    
    /**
     * @dev Get verification trigger type for a document
     * @param documentId The document ID
     */
    function getVerificationTrigger(uint256 documentId) 
        external 
        view 
        documentExists(documentId) 
        returns (TriggerType) 
    {
        return verificationTriggers[documentId];
    }
    
    /**
     * @dev Batch process automated verifications (can be called by anyone)
     * @param documentIds Array of document IDs to process
     */
    function batchProcessAutomatedVerifications(uint256[] calldata documentIds) external {
        for (uint256 i = 0; i < documentIds.length; i++) {
            if (documents[documentIds[i]].id != 0) {
                _checkAutomatedVerificationTriggers(documentIds[i]);
            }
        }
    }
    
    /**
     * @dev Set the multi-signature contract address (admin only)
     * @param _multiSig The multi-signature contract address
     */
    function setMultiSigContract(address _multiSig) external {
        require(
            accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
            "Only admin can set multi-sig contract"
        );
        multiSig = SealGuardMultiSig(_multiSig);
    }
    
    /**
     * @dev Initialize multi-signature requirements for document types
     */
    function _initializeMultiSigRequirements() internal {
        // Legal documents require multi-sig for high-value operations
        typeRequiresMultiSig["legal"] = true;
        
        // Financial documents require multi-sig for transfers and archiving
        typeRequiresMultiSig["financial"] = true;
        
        // Identity documents require multi-sig for verification
        typeRequiresMultiSig["identity"] = true;
        
        // Medical documents require multi-sig for sensitive operations
        typeRequiresMultiSig["medical"] = true;
        
        // Contracts require multi-sig for ownership transfers
        typeRequiresMultiSig["contract"] = true;
    }
    
    /**
     * @dev Check if document requires multi-signature approval
     * @param documentId The document ID
     */
    function requiresMultiSigApproval(uint256 documentId) external view documentExists(documentId) returns (bool) {
        // Check document-specific requirement first
        if (requiresMultiSig[documentId]) {
            return true;
        }
        
        // Check document type requirement
        Document memory doc = documents[documentId];
        return typeRequiresMultiSig[doc.documentType];
    }
    
    /**
     * @dev Set multi-signature requirement for a specific document (admin only)
     * @param documentId The document ID
     * @param required Whether multi-sig is required
     */
    function setDocumentMultiSigRequirement(
        uint256 documentId,
        bool required
    ) external documentExists(documentId) {
        require(
            accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
            "Only admin can set multi-sig requirements"
        );
        
        requiresMultiSig[documentId] = required;
        Document memory doc = documents[documentId];
        
        emit MultiSigRequirementSet(documentId, required, doc.documentType);
    }
    
    /**
     * @dev Set multi-signature requirement for a document type (admin only)
     * @param documentType The document type
     * @param required Whether multi-sig is required
     */
    function setTypeMultiSigRequirement(
        string memory documentType,
        bool required
    ) external {
        require(
            accessControl.hasRoleOrHigher(msg.sender, accessControl.ADMIN_ROLE()),
            "Only admin can set multi-sig requirements"
        );
        
        typeRequiresMultiSig[documentType] = required;
        
        emit MultiSigRequirementSet(0, required, documentType);
    }
    
    /**
     * @dev Mark document as multi-sig verified (called by multi-sig contract)
     * @param documentId The document ID
     * @param proposalId The multi-sig proposal ID
     */
    function markMultiSigVerified(
        uint256 documentId,
        uint256 proposalId
    ) external documentExists(documentId) {
        require(msg.sender == address(multiSig), "Only multi-sig contract can call this");
        
        multiSigVerified[documentId] = true;
        
        emit MultiSigVerificationCompleted(documentId, address(multiSig), proposalId);
    }
    
    /**
     * @dev Check if document has been multi-sig verified
     * @param documentId The document ID
     */
    function isMultiSigVerified(uint256 documentId) external view documentExists(documentId) returns (bool) {
        return multiSigVerified[documentId];
    }
}

